				["custom"] = "function(allstates, event, ...)\n    local timestamp = GetTime()\n    \n    if aura_env.debug then \n        aura_env.spells = aura_env.debugSpells\n        aura_env.mcAbleSpells = aura_env.mcAbleSpellsDebug\n    end\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and aura_env.spells[select(12, ...)]then \n        aura_env.tempStoreId = select(12, ...)\n        --aura_env.tempStoreSchool = select(14, ...) \n        if aura_env.tempStoreId == aura_env.trackedSpell then \n            allstates[aura_env.index] = allstates[aura_env.index] or {}\n            local state = allstates[aura_env.index]\n            local spellSchoolTemp = select(14, ...)\n            local raidFlag = select(7, ...) \n            state.spellSchool = select(14, ...) \n            \n            --local playerGUID = playerGUID or UnitGUID(\"player\")\n            \n            state.spellColor = COMBATLOG_DEFAULT_COLORS.schoolColoring[spellSchoolTemp]\n            WeakAuras.GetRegion(aura_env.id, lineID):SetInverse(false)\n            state.changed = true\n            \n            local currentMark = select(7, ...)\n            \n            state.raidMark = currentMark\n            state.marked = false\n            if currentMark ~= 0 then\n                state.marked = true\n                if currentMark == 4 then\n                    state.raidMark = 3\n                elseif currentMark == 8 then\n                    state.raidMark = 4\n                elseif currentMark == 16 then\n                    state.raidMark = 5\n                elseif currentMark == 32 then \n                    state.raidMark = 6\n                elseif currentMark == 64 then\n                    state.raidMark = 7\n                elseif currentMark == 128 then\n                    state.raidMark = 8\n                end\n            end\n            return true\n        end\n    end\n    \n    if event == \"UNIT_SPELLCAST_START\"  then\n        local unitID, spell, rank, lineID, spellID = ...\n        if aura_env.mcAbleSpells[spellID] and aura_env.isMobMcd(unitID) then\n            return true\n        end\n        \n        if aura_env.spells[spellID] then\n            aura_env.trackedSpell = spellID\n            local _, rank, icon, castingTime, minRange, maxRange, spellID = GetSpellInfo(spellID)\n            local playerHaste = UnitSpellHaste(\"player\")\n            \n            local duration = ((playerHaste/100 + 1) * castingTime)*.001\n            \n            \n            name = GetUnitName(unitID)\n            allstates[lineID] = allstates[lineID] or {}\n            local state = allstates[lineID]\n            \n            \n            if string.find(unitID , \"nameplate\") then \n                targetUnit = unitID..\"-target\"\n                if UnitIsUnit(targetUnit, \"player\") then \n                    state.onMe = true \n                end\n            end\n            \n            \n            \n            aura_env.index = lineID\n            \n            state.name = name\n            state.icon = icon\n            state.duration = duration\n            state.spellId = spellID\n            state.progressType = \"timed\"\n            state.expirationTime= timestamp + duration\n            state.spellSchool = \"0\"\n            state.autoHide = true\n            state.changed = true\n            state.show = true            \n            return true\n        end\n    end\n    \n    if event == \"UNIT_SPELLCAST_CHANNEL_START\" then\n        \n        local unitID, spell, rank, lineID, spellID = ...\n        if string.find(unitID, \"nameplate\") then\n            if aura_env.spells[spellID] then\n                aura_env.trackedSpell = spellID\n                local _, _, icon, _, _, _, spellID = GetSpellInfo(spellID)\n                local name, _, _, _, startTime, endTime = UnitChannelInfo(unitID)\n                \n                local castingTime = endTime - startTime\n                local playerHaste = GetCombatRatingBonus(CR_HASTE_SPELL)\n                if castingTime then \n                    local duration = castingTime*.001\n                    name = GetUnitName(unitID)\n                    \n                    allstates[unitID] = allstates[unitID] or {}\n                    local state = allstates[unitID]\n                    \n                    \n                    aura_env.index = unitID \n                    state.name = name\n                    state.icon = icon\n                    state.duration = duration\n                    state.spellId = spellID\n                    state.progressType = \"timed\"\n                    state.expirationTime= timestamp + duration\n                    state.spellSchool = \"0\"\n                    state.autoHide = true\n                    state.changed = true\n                    state.show = true\n                    return true\n                end\n            end\n            \n        end\n    end\n    \n    if event == \"UNIT_SPELLCAST_INTERRUPTED\" then\n        local unitID, spell, rank, lineID, spellID = ...\n        if spellID == aura_env.trackedSpell and allstates[lineID] then\n            allstates[lineID] = allstates[lineID] or {}\n            local state = allstates[lineID]\n            WeakAuras.GetRegion(aura_env.id, lineID):SetInverse(true)\n            state.name = \"Interrupted\" \n            state.progressType = \"static\" \n            state.value = 0\n            state.total = 1\n            state.expirationTime= GetTime() + aura_env.interupptDelay\n            state.spellColor = {r=1,b=0,g=0,a=1}\n            state.interrupted = true\n            state.changed = true \n            return true\n        end\n    end\n    \n    if event == \"UNIT_SPELLCAST_CHANNEL_STOP\" then\n        local unitID, spell, rank, lineID, spellID = ...\n        if spellID == aura_env.trackedSpell and allstates[unitID] then\n            local state = allstates[unitID]\n            state.name = \"Interrupted\" \n           