					["colorFunc"] = "function(progress, r1, g1, b1, a1, r2, g2, b2, a2)\n    \n    if aura_env\n    and aura_env.state \n    then\n        local bar = WeakAuras.regions[aura_env.id].region.bar\n        local cast = select(6, UnitCastingInfo(\"player\")) or select(6, UnitChannelInfo(\"player\"))\n        \n        if cast then\n            local remaining = (cast/1000) - GetTime()\n            local barWidth = bar:GetWidth()\n            local widthPerSec = barWidth / aura_env.state.duration\n            bar.cast:SetWidth(math.min(widthPerSec*remaining,barWidth))\n            bar.cast:Show()\n        else \n            bar.cast:Hide()\n        end\n        \n        if cast and cast/1000 < aura_env.state.expirationTime then\n            WeakAuras.regions[aura_env.id].region.text:SetText(\"OK!\")\n            return r1,g1,b1,a1\n        elseif cast and cast/1000 > aura_env.state.expirationTime then\n            WeakAuras.regions[aura_env.id].region.text:SetText(\"Stop!\")\n            if aura_env.airhorn and not aura_env.triggered then\n                PlaySoundFile(aura_env.sound, \"master\")\n                aura_env.triggered = true\n            end\n            return r2, g2, b2, a2\n        end\n        WeakAuras.regions[aura_env.id].region.text:SetText(\"Quaking\")\n        return r1,g1,b1,a1\n    end\nend",
