				["custom"] = "function(event, ...)\n    local me = UnitGUID(WeakAuras.me)\n    if event == \"UNIT_SPELLCAST_SUCCEEDED\" and UnitGUID(select(1, ...)) == me then -- Healthstone cast\n        local _, lineId, spellID = ...\n        if spellID == 6201 or 29893 then\n            print(\"Healthstones placd at:\", GetTime())\n            aura_env.hsPlacedTime = GetTime()\n            WeakAuras.ScanEvents(\"KRIXI_HS_RESPONSE\", me, 120000)\n        end\n    end\n    \n    if event == \"KRIXI_HS_REQUEST\" then\n        if select(3,UnitClass(\"player\")) == 9 then -- 9 = warlock\n            \n            local hsDownTimer = aura_env.hsPlacedTime - GetTime()\n            \n            if hsDownTimer < 0 then -- if healthstones are not down put up reminder to put hs\n                print(\"Healthstones requested but not down\")\n                -- put healthstones \n            else            \n                print(\"Healthstones requested and down, sending response event\")\n                print(\"sending event with params\", me, hsDownTimer)\n                WeakAuras.ScanEvents(\"KRIXI_HS_RESPONSE\", me, hsDownTimer)\n            end\n        end \n    end\n    \n    if event == \"KRIXI_HS_RESPONSE\" then\n        aura_env.responseSource = select(1, ...)\n        aura_env.responseExpiryTime = GetTime() + select(2, ...)\n        return true\n        \n    end \nend",
