		["Bolstering"] = {
			["text2Point"] = "TOP",
			["text1FontSize"] = 28,
			["disjunctive"] = "all",
			["customText"] = "function()\n    -- This sets the altText so please leave it as it is.\n    aura_env.altTextFunction()\n    \n    \n    -- if you want to also use a regular custom text then you return that here\n    counter_bolstering = 0\n    \n    if WeakAuras.IsOptionsOpen() then\n        counter_bolstering = 5\n    end \n    \n    for i=1, 40, 1 do\n        local i_spellID = select(11, UnitBuff(aura_env.unitID,i))\n        if i_spellID and i_spellID==aura_env.spellID then\n            counter_bolstering = counter_bolstering + 1  \n        end\n    end\n    aura_env.counter_bolstering = counter_bolstering\n    if counter_bolstering > 0 then\n        return counter_bolstering * 20\n    end\n    return aura_env.alternativeText\nend",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = -10,
			["customTextUpdate"] = "update",
			["url"] = "https://wago.io/Icon_2text/12",
			["actions"] = {
				["start"] = {
					["custom"] = "aura_env.altText:Show()",
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "aura_env.spellID = 209859 -- Change to whatever debuff you want to keep track\naura_env.unitID = \"target\"\naura_env.filter = \"helpful\"\naura_env.alternativeText = \"BOLSTERED\"\naura_env.counter_bolstering = 0\n\n-- credit for below part goes to asakawa!\n-- Settings below - alter as you like!\n\n-- Main settings:\nlocal font = \"Fonts\\\\FRIZQT__.TTF\" -- e.g. \"Interface\\\\AddOns\\\\SharedMedia\\\\fonts\\\\Expressway.ttf\" \nlocal fontFlags = \"THICKOUTLINE\" --\"OUTLINE\", \"THICKOUTLINE\", \"MONOCHROME\" - e.g. \"OUTLINE, MONOCHROME\"\nlocal fontSize = 60\nlocal xOffset = 0 -- horixontal offset from centre +right, -left\nlocal yOffset = 0 -- vertical offset from middle +up, -down\nlocal anchor = \"CENTER\" --CENTER,BOTTOM,TOP,LEFT,RIGHT,BOTTOMLEFT,BOTTOMRIGHT,TOPLEFT,TOPRIGHT\nlocal containment = \"OUTSIDE\" -- \"INSIDE\" or \"OUTSIDE\", just like in the normal WA settings\nlocal textColour = { -- colour values for the text, between 0 and 1\n    [\"r\"] = 1, -- red value\n    [\"g\"] = 0, -- green value\n    [\"b\"] = 0, -- blue value\n    [\"a\"] = 1 -- alpha value (opacity)\n}\n\n--  Simple Text Output: (can use placeholders %s, %n, %p, %t)\nlocal text_output = \"\" -- leave empty if using a custom function\n\n-- Custom Function for more complex outputs:\naura_env.altTextFunction = function()\n    \n    local myText = aura_env.counter_bolstering -- create your text output\n    aura_env.altText:SetText(myText) -- Send it to the altText\n    \nend\n\n-- Extra settings:\nlocal Justify_Hor = \"CENTER\" -- \"CENTER\", \"LEFT\", \"RIGHT\"\nlocal Justify_Ver = \"TOP\" -- \"TOP\", \"MIDDLE\", \"BOTTOM\"\nlocal Word_Wrap = true\nlocal text_Width = 0 -- Leave at zero to adjust dynamically\nlocal text_Height = 0 -- Leave at zero to adjust dynamically\nlocal rotate = 0 -- rotate the text + or -\n\n-- ###############################################\n-- ### Do not alter anything below this point! ###\n-- ###############################################\n\n--if WeakAuras.regions[aura_env.id].region.altText then\n--    WeakAuras.regions[aura_env.id].region.altText:Hide()\n--end\nlocal function animRotate(object, degrees, anchor)\n    if (not anchor) then\n        anchor = \"CENTER\";\n    end\n    -- Something to rotate\n    if object.animationGroup or degrees ~= 0 then\n        -- Create AnimatioGroup and rotation animation\n        object.animationGroup = object.animationGroup or object:CreateAnimationGroup();\n        local group = object.animationGroup;\n        group.rotate = group.rotate or group:CreateAnimation(\"rotation\");\n        local rotate = group.rotate;\n        \n        rotate:SetOrigin(anchor, 0, 0);\n        rotate:SetDegrees(degrees);\n        rotate:SetDuration(0);\n        rotate:SetEndDelay(2147483647);\n        group:Play();\n        rotate:SetSmoothProgress(1);\n        group:Pause();\n    end\nend\n\nlocal region = WeakAuras.regions[aura_env.id].region\nif not region.altText then\n    local altTextFrame = CreateFrame(\"frame\", nil, region);\n    local altText = altTextFrame:CreateFontString(nil, \"OVERLAY\");\n    region.altText = altText\nend\naura_env.altText = region.altText\n\nlocal regionFrameLevel = region:GetFrameLevel()\nregion.altText:GetParent():SetFrameLevel(regionFrameLevel+1)\n\nif(containment == \"INSIDE\") then\n    region.altText:ClearAllPoints()\n    region.altText:SetPoint(anchor, region, anchor, xOffset, yOffset);\nelse\n    local selfPoint = WeakAuras.inverse_point_types[anchor];\n    region.altText:ClearAllPoints()\n    region.altText:SetPoint(selfPoint, region, anchor, xOffset, yOffset);\nend\n\nregion.altText:SetFont(font, fontSize, fontFlags) \nregion.altText:SetTextColor(textColour.r, textColour.g, textColour.b, textColour.a)\nregion.altText:SetJustifyH(Justify_Hor)\nregion.altText:SetJustifyV(Justify_Ver)\nregion.altText:SetWordWrap(Word_Wrap)\nregion.altText:SetSize(text_Width, text_Height)\nregion.altText:SetText(\"\")\nif rotate ~= 0 then animRotate(region.altText, rotate) end\n\nif text_output ~= \"\" then\n    aura_env.altTextFunction = function()\n        if (text_output:find('%%')) then\n            local replaceStringCache = {};\n            text_out = WeakAuras.ReplacePlaceHolders(text_output, region);\n            region.altText:SetText(text_out)\n        else \n            region.altText:SetText(text_output)\n        end\n    end\nend",
