					["custom"] = "aura_env.absorbCapped = function(text, slAbsorb, maxHealth, demonSkin)\n    \n    local maxAbsorb = maxHealth / 10\n    \n    if demonSkin then -- if demonskin change max to 15% of maxhp\n        maxAbsorb = maxHealth / 100 * 15        \n    end \n    \n    if slAbsorb == maxAbsorb then \n        return(\"|cff1eff00\" .. text .. \"|r\")   -- color text green\n    elseif slAbsorb > maxAbsorb then\n        return(\"|cffff8000\" .. text .. \"|r\")  -- color text orange\n    else \n        return(\"|cffffffff\" .. text .. \"|r\")  -- color text white \n    end\nend\n\naura_env.roundNumber = function(number,divider) -- round divide and round\n    return string.format(\"%.1f\", number/divider)    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
