					["custom"] = "aura_env.output = true -- change to false to disable post fight output\n\n\n\n\n\n\n\n\n\n\n\n\n\n\naura_env.chaosStrikeHit = 0\naura_env.chaosStrikeCrit = 0\naura_env.anniHit = 0\naura_env.anniCrit = 0 \naura_env.player = UnitGUID(\"player\")\n\naura_env.currentCrit = 0.0\naura_env.csCritPercent = 0.0\naura_env.anCritPercent = 0.0\n\n--print(\"|cffff0000 Red Text |r White Text |cFF00FF00 Green Text\")\n\n\nfunction ColorOutput(text, value1, value2)\n    local playerCrit = tonumber(value2)\n    local actualCrit = tonumber(value1)\n    \n    if actualCrit < playerCrit then \n        print(\"|cffff0000\" .. text .. \"%|r\")    \n    elseif actualCrit > playerCrit then\n        print(\"|cFF00FF00\" .. text .. \"%|r\") \n    else \n        print(\"|r\" .. text .. \"%|r\") \n    end\nend\n\nfunction ColorOutputReturn(text, value1, value2)\n    local playerCrit = tonumber(value2)\n    local actualCrit = tonumber(value1)\n    \n    if actualCrit < playerCrit then \n        return(\"|cffff0000\" .. text .. \"%|r\")    \n    elseif actualCrit > playerCrit then\n        return(\"|cFF00FF00\" .. text .. \"%|r\") \n    else \n        return(\"|r\" .. text .. \"%|r\") \n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
