				["spellIds"] = {
				},
				["custom"] = "function(event, ...)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then \n        local timeStamp, message, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellId, spellName, spellSchool, extraSpellID, extraSpellName, extraSchool = ...        \n        local chaosStrikeId1 = 199547\n        local chaosStrikeId2 = 222031\n        local annihilationId1 = 227518\n        local annihilationId2 = 201428\n        \n        if message == \"SPELL_DAMAGE\" and sourceGUID == aura_env.player then -- if spell dmg and from player            \n            if spellId == chaosStrikeId1 or spellId == chaosStrikeId2 then -- if spell was chaos strike\n                if select(21, ...) then -- if the spell critted\n                    aura_env.chaosStrikeCrit = aura_env.chaosStrikeCrit + 1\n                else \n                    aura_env.chaosStrikeHit = aura_env.chaosStrikeHit + 1\n                end\n            end\n            \n            if spellId == annihilationId1 or spellId == annihilationId2 then -- if spell was annihilation\n                if select(21, ...) then -- if the spell critted\n                    aura_env.anniCrit = aura_env.anniCrit + 1\n                else \n                    aura_env.anniHit = aura_env.anniHit + 1\n                end\n            end\n            \n            \n            aura_env.csCritPercent = string.format(\"%.1f\", (100 * (aura_env.chaosStrikeCrit / (aura_env.chaosStrikeCrit + aura_env.chaosStrikeHit)))) \n            aura_env.anCritPercent = string.format(\"%.1f\", (100 * (aura_env.anniCrit / (aura_env.anniCrit + aura_env.anniHit)))) \n            \n            if aura_env.chaosStrikeHit == 0 and aura_env.chaosStrikeCrit == 0 then aura_env.csCritPercent = 0.0 end -- if i havent casted  cs yet\n            if aura_env.anniHit == 0 and aura_env.anniCrit == 0 then aura_env.anCritPercent = 0.0 end -- if i havent casted an yet\n            \n        end\n    end\n    if event == \"PLAYER_REGEN_DISABLED\" then\n        aura_env.chaosStrikeHit = 0\n        aura_env.chaosStrikeCrit = 0\n        aura_env.anniHit = 0\n        aura_env.anniCrit = 0 \n        -- print(\"Entering Combat Resetting stats\")\n        aura_env.currentCrit = string.format(\"%.2f\",GetCritChance()) \n    end\n    \n    if event == \"PLAYER_REGEN_ENABLED\" and aura_env.output then\n        print(\"-----------\")\n        print(\"Crit chance: \" .. aura_env.currentCrit .. \"%\")\n        print(\"Chaos Strike Crit: \" .. ColorOutputReturn( aura_env.csCritPercent, aura_env.csCritPercent, aura_env.currentCrit))\n        print(\"Annihilation Crit: \" .. ColorOutputReturn( aura_env.anCritPercent, aura_env.anCritPercent, aura_env.currentCrit))\n        print(\"-----------\")\n    end\n    \nend",
