				["init"] = {
					["custom"] = "aura_env.options = {\n    readyTextGreen = true,\n}\n\n\n\naura_env.trackedSpells = { --[spellId]=cooldown\n    [47528]  = 15, --Mind Freeze\n    [106839] = 15, --Skull Bash\n    [78675]  = 60, --Solar Beam\n    [183752] = 15, --Consume Magic\n    [147362] = 24, --Counter Shot\n    [187707] = 15, --Muzzle\n    [2139]   = 24, --Counter Spell\n    [116705] = 15, --Spear Hand Strike\n    [96231]  = 15, --Rebuke\n    [15487]  = 45, --Silence\n    [1766]   = 15, --Kick\n    [57994] = 12, --Wind Shear\n    [6552]  = 15, --Pummel\n    [171140] = 24, --Shadow Lock\n    [171138] = 24, --Shadow Lock if used from pet bar\n    \n    [19647] = 24, -- Spell Lock\n    --[[ potential track more spells\n    [171152] = 60, --Meteor Strike\n    [171017] = 60, --Meteor Strike if used from pet bar\n    --]]\n    \n    \n}\n\nWeakAurasSaved['displays'][aura_env.id].uniqueId = \"NnoggaM+InterruptTracker\"\n\naura_env.lastUse = {}\n\n--https://wago.io/profile/asakawa\n--usage:\n--for unit in aura_env.GroupMembers() do\n-- --do stuff\n--end\nfunction aura_env.GroupMembers(reversed, forceParty)\n    local unit  = (not forceParty and IsInRaid()) and 'raid' or 'party'\n    local numGroupMembers = forceParty and GetNumSubgroupMembers()  or GetNumGroupMembers()\n    local i = reversed and numGroupMembers or (unit == 'party' and 0 or 1)\n    return function()\n        local ret \n        if i == 0 and unit == 'party' then \n            ret = 'player'\n        elseif i <= numGroupMembers and i > 0 then\n            ret = unit .. i\n        end\n        i = i + (reversed and -1 or 1)\n        return ret\n    end\nend\n\n\n--returns class colored for valid units\nfunction aura_env.getColored(unit)\n    if not unit then return end\n    local function DecimalToHex(r,g,b)\n        return string.format(\"|cff%02x%02x%02x\", r*255, g*255, b*255)\n    end\n    local playername = UnitName(unit)\n    local playerclass,PLAYERCLASS = UnitClass(unit)\n    if not PLAYERCLASS then return unit end\n    local classcolor = RAID_CLASS_COLORS[PLAYERCLASS]\n    if not classcolor then return unit end\n    local r,g,b = classcolor.r,classcolor.g,classcolor.b\n    if UnitIsDeadOrGhost(unit) then r,g,b = 0.5,0.5,0.5 end        \n    local classcolorhex = DecimalToHex(r,g,b)\n    return classcolorhex..playername..\"|r\"\nend",
