				["spellIds"] = {
				},
				["custom"] = "function(allstates,event,...)\n    \n    local subevent = select(2,...)\n    if subevent == \"SPELL_CAST_SUCCESS\" then\n        local sourceName = select(5,...)\n        local sourceGUID = select(4,...)\n        local spellId = select(12,...)\n        if aura_env.trackedSpells[spellId] then\n            sourceName = gsub(sourceName, \"%-[^|]+\", \"\") --strip realm name\n            --Attribute Pet Spell's to its owner\n            local type = strsplit(\"-\",sourceGUID)\n            if type == \"Pet\" then\n                for unit in aura_env.GroupMembers() do\n                    if UnitGUID(unit..\"pet\") == sourceGUID then\n                        sourceGUID = UnitGUID(unit)                        \n                        sourceName = UnitName(unit)\n                        sourceName = gsub(sourceName, \"%-[^|]+\", \"\")\n                        break\n                    end\n                end\n            end\n            \n            --merge warlock spellIds\n            if spellId == 171138 then spellId = 171140 end\n            if spellId == 171017 then spellId = 171152 end\n            \n            --recover old states for the same spellId and sourceGUID            \n            local state\n            for idx,s in pairs(allstates) do\n                if s.sourceGUID == sourceGUID and s.spellId == spellId then\n                    state = s\n                end\n            end\n            if not state then\n                local idx = #allstates+1\n                allstates[idx] = allstates[idx] or {}\n                state = allstates[idx]\n            end\n            \n            state.show = true\n            state.changed = true\n            state.sourceName = sourceName\n            state.progressType = 'timed'\n            state.autoHide = false\n            state.resort = true\n            state.duration = aura_env.trackedSpells[spellId]\n            state.expirationTime = aura_env.trackedSpells[spellId] + GetTime() \n            local icon = select(3,GetSpellInfo(spellId))\n            state.icon = icon\n            state.sourceGUID = sourceGUID\n            state.spellId = spellId\n            \n            aura_env.lastUse[sourceGUID] = aura_env.lastUse[sourceGUID] or {}\n            aura_env.lastUse[sourceGUID][spellId] = GetTime()\n            \n            return true\n            \n        end\n        \n    end\n    \n    --Infernal/Doomguard Workaround\n    if subevent == \"SPELL_SUMMON\" then\n        local spellId = select(12,...)\n        local sourceGUID = select(4,...)\n        if spellId == 157898 then            \n            --recover meteor strike state\n            if aura_env.trackedSpells[171152] then\n                local state\n                for idx,s in pairs(allstates) do\n                    if s.sourceGUID == sourceGUID and s.spellId == 171152 then\n                        state = s\n                    end\n                end\n                if not state then\n                    local idx = #allstates+1\n                    allstates[idx] = allstates[idx] or {}\n                    state = allstates[idx]\n                end          \n                state.show = true\n                state.changed = true\n                state.sourceName = select(5,...)\n                state.progressType = 'timed'\n                state.autoHide = false\n                state.resort = true\n                state.duration = 60\n                state.expirationTime = (aura_env.lastUse[sourceGUID] and aura_env.lastUse[sourceGUID][171152] or 0) + 60\n                local icon = select(3,GetSpellInfo(171152))\n                state.icon = icon\n                state.sourceGUID = sourceGUID\n                state.spellId = 171152\n            end\n            \n            \n            --hide shaodw lock state\n            for idx,state in pairs(allstates) do\n                if state.sourceGUID == sourceGUID and state.spellId == 171140 then\n                    state.show = false\n                    state.changed = true                    \n                end                \n            end\n            return true\n        end\n        if spellId == 157757 then --Summon Doomguard\n            --recover shadow lock state\n            local state\n            for idx,s in pairs(allstates) do\n                if s.sourceGUID == sourceGUID and s.spellId == 171140 then\n                    state = s\n                end\n            end\n            if not state then\n                local idx = #allstates+1\n                allstates[idx] = allstates[idx] or {}\n                state = allstates[idx]\n            end          \n            state.show = true\n            state.changed = true\n            state.sourceName = select(5,...)\n            state.progressType = 'timed'\n            state.autoHide = false\n            state.resort = true\n            state.duration = 24\n            state.expirationTime = (aura_env.lastUse[sourceGUID] and aura_env.lastUse[sourceGUID][171140] or 0) + 24\n            local icon = select(3,GetSpellInfo(171140))\n            state.icon = icon\n            state.sourceGUID = sourceGUID\n            state.spellId = 171140\n            \n            --hide meteor strike state\n            for idx,state in pairs(allstates) do\n                if state.sourceGUID == sourceGUID and state.spellId == 171152 then\n                    state.show = false\n                    state.changed = true\n                end                \n            end\n            \n            return true\n        end\n        \n        \n        \n    end\n    \n    \n    \n    --Solarbeam Workaround\n    if subevent == \"SPELL_INTERRUPT\" then\n        local sourceGUID = select(4,...)\n        local spellId = select(12,...)\n        if spellId == 97547 then\n            local state\n            for idx,s in pairs(allstates) do\n                if s.sourceGUID == sourceGUID and s.spellId == 78675 then\n                    state = s\n                end\n            end\n            state.changed = true\n            state.duration = 45\n            state.expirationTime = GetTime()+45\n            return true\n        end\n    end\n    \n    \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
