			["text1FontSize"] = 20,
			["xOffset"] = -119.999206542969,
			["customText"] = "-- written by [EU] Reloe-Blackrock - Btag: Reloe#2787 - Discord: Reloe#6641\nfunction()\n    local coloredName = function(unit)\n        local _, class = UnitClass(unit)\n        return string.format(\"|c%s%s\", RAID_CLASS_COLORS[class].colorStr, unit)\n    end\n    aura_env.result = \"\"\n    aura_env.tanks = aura_env.tanks or {}\n    aura_env.spells = aura_env.spells or {}\n    \n    for key, value in pairs(aura_env.tanks) do \n        for key2, value2 in pairs(aura_env.spells) do\n            local name = key\n            local spell = GetSpellInfo(key2)\n            if WA_GetUnitDebuff(name, spell) then\n                local _, _, _, stacks = WA_GetUnitDebuff(name, spell)\n                name, _ = UnitName(name)\n                if stacks == 0 then\n                    aura_env.result = aura_env.result..coloredName(name)..\"\\n\"\n                else\n                    aura_env.result = aura_env.result..coloredName(name)..\"|cFFFFFFFF - \"..stacks..\"\\n\"\n                end\n            end\n        end\n    end\n    \n    return aura_env.result\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["untrigger"] = {
				["custom"] = "function(event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, spellName, spellSchool)\n    if event == \"ENCOUNTER_END\" and GetTime() >= aura_env.time+0.5 and aura_env.time ~= 0 then\n        aura_env.tanks = {}\n        aura_env.icon = \"\"\n        aura_env.duration = 0\n        aura_env.max = 0\n        aura_env.time = 0\n        return true\n    end\n    \n    if subevent == \"SPELL_AURA_REMOVED\" then\n        if aura_env.spells[spellID] and aura_env.tanks[destName] then\n            aura_env.untrigger = true\n            for key, value in pairs(aura_env.tanks) do \n                for key2, value2 in pairs(aura_env.spells) do\n                    if WA_GetUnitDebuff(key, GetSpellInfo(key2)) then\n                        aura_env.untrigger = false\n                        _, _, aura_env.icon = WA_GetUnitDebuff(key, GetSpellInfo(key2))\n                        return false\n                    end\n                end\n            end\n            \n            if aura_env.untrigger == true then\n                aura_env.icon = \"\"\n                aura_env.duration = 0\n                aura_env.max = 0\n                aura_env.time = 0\n                return true\n            end\n        end\n    end\nend",
			},
