				["check"] = "event",
				["custom"] = "-- written by [EU] Reloe-Blackrock - Btag: Reloe#2787 - Discord: Reloe#6641\nfunction(event, timestamp, subevent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, spellName, spellSchool)\n    if WeakAuras.CurrentEncounter then\n        local Id = WeakAuras.CurrentEncounter.id\n        if Id==2076 or Id==2070 or Id==2064 or Id==2082 or Id==2088 or Id==2069 or Id==2073 or Id==2063 or Id==2092 then\n            if event == \"ENCOUNTER_START\" then\n                aura_env.time = GetTime()\n                aura_env.tanks = {}\n                aura_env.icon = \"\"\n                aura_env.duration = 0\n                aura_env.max = 0\n                for i=1, GetNumGroupMembers() do\n                    local name = GetRaidRosterInfo(i)\n                    if UnitIsVisible(name) and name ~= UnitName(\"player\") and UnitGroupRolesAssigned(name) == \"TANK\" then\n                        aura_env.tanks[name] = true\n                    end\n                end\n            end\n            if subevent == \"SPELL_AURA_APPLIED\" or \"SPELL_AURA_APPLIED_DOSE\" or \"SPELL_REFRESH\" then\n                if aura_env.spells[spellID] and aura_env.tanks[destName] then\n                    if UnitDebuff(destName, GetSpellInfo(spellID)) then\n                        _, _, aura_env.icon, _, _, aura_env.duration, aura_env.max = WA_GetUnitDebuff(destName, GetSpellInfo(spellID))\n                        return true\n                    end\n                end\n            end\n            if subevent == \"SPELL_AURA_REMOVED\" then\n                if aura_env.spells[spellID] and aura_env.tanks[destName] then\n                    aura_env.untrigger = true\n                    for key, value in pairs(aura_env.tanks) do \n                        for key2, value2 in pairs(aura_env.spells) do\n                            if WA_GetUnitDebuff(key, GetSpellInfo(key2)) then\n                                _, _, aura_env.icon, _, _, aura_env.duration, aura_env.max = WA_GetUnitDebuff(key, GetSpellInfo(key2))\n                                aura_env.untrigger = false\n                                return true\n                            end\n                        end\n                    end\n                end\n            end\n        end\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
