				["init"] = {
					["do_custom"] = false,
					["custom"] = "-- SETTINGS:\n\n-- icon inset amount\nlocal top = -2\nlocal right = -2\nlocal bottom = -2\nlocal left = -2\n\n-- border colour (RGBA values between0 and 1)\nlocal red = 0\nlocal green = 1\nlocal blue = 1\nlocal alpha = 1\n\n-- Do you want the CD sweep to be over the icon (false) or border (true)?\nlocal borderCD = true\n\n-- END SETTINGS -- \n\nlocal region = WeakAuras.regions[aura_env.id].region\n\naura_env.backdropFunc = function()\n    \n    \n    \n    if region.Backdrop then\n        region.Backdrop:SetBackdropColor(red,green,blue,alpha);\n        \n        --set the icon inset\n        region.icon:ClearAllPoints()\n        region.icon:SetPoint(\"BOTTOMLEFT\", region, \"BOTTOMLEFT\", left,bottom);\n        region.icon:SetPoint(\"TOPRIGHT\", region, \"TOPRIGHT\", right,top);\n        \n        local regionFrameLevel = region:GetFrameLevel() -- get strata for next bit\n        region.Backdrop:SetFrameLevel(regionFrameLevel-2) -- put the border at the back\n        if borderCD then -- if we want the CD sweep on the border only\n            region.cooldown:SetFrameLevel(regionFrameLevel-1) -- then CD sweep\n            region.cooldown:SetAllPoints(region.Backdrop) -- attach sweep to border\n        else -- if we want the sweep to behave normally, on the icon\n            region.cooldown:SetFrameLevel(regionFrameLevel+1) -- put sweep on top\n            region.cooldown:SetAllPoints(region.icon) -- attach to the icon\n        end\n    end\nend\naura_env.backdropFunc()",
