				["use_spellId"] = false,
				["name"] = "Anti-Magic Shell",
				["use_spellName"] = false,
				["custom"] = "function(allstates, event,...)\n    if type(allstates) ~= \"table\" then\n        return\n    end\n    \n    local _,subevent = ...\n    \n    --Active Mitigation fix (there is no refresh event)\n    if subevent == \"SPELL_CAST_SUCCESS\" then\n        local spellId = select(12,...)\n        local destName = select(5,...)\n        if IsInGroup() and aura_env.activeMitigation[spellId] then\n            local unit            \n            for u in aura_env.GroupMembers() do\n                if UnitName(u) == destName then unit = u end\n            end\n            if not unit then return end\n            spellId = aura_env.activeMitigation[spellId]\n            for _, state in pairs(allstates) do\n                if state.spellId == spellId and state.name == destName then\n                    local spellName = GetSpellInfo(spellId)\n                    local _,_,icon, count,_, duration, expires = WA_GetUnitAura(state.unit, spellName)\n                    \n                    state.show = true;\n                    state.changed = true;\n                    state.name = destName\n                    state.progressType = 'timed'\n                    state.autoHide = true\n                    state.changed = true\n                    state.spellId = spellId\n                    state.icon = icon\n                    state.duration = duration\n                    state.expirationTime = expires\n                    state.unit = state.unit\n                end\n            end\n            \n        end        \n    end\n    \n    if subevent == \"SPELL_AURA_APPLIED\" then \n        local destName = select(9,...)\n        destName = gsub(destName, \"%-[^|]+\", \"\") --strip realm name\n        local spellId = select(12,...)\n        if aura_env.trackedSpells[spellId] and IsInGroup() then            \n            local unit            \n            for u in aura_env.GroupMembers() do\n                if UnitName(u) == destName then unit = u end\n            end\n            if not unit then return end\n            local spellName = GetSpellInfo(spellId)\n            local _,_,icon, count,_, duration, expires = WA_GetUnitAura(unit, spellName)\n            local idx = #allstates+1\n            allstates[idx] = {};\n            local state = allstates[idx];\n            state.ID = idx\n            state.show = true;\n            state.changed = true;\n            state.name = destName\n            state.progressType = 'timed'\n            state.autoHide = true\n            state.changed = true\n            state.spellId = spellId\n            state.icon = icon\n            state.duration = duration\n            state.expirationTime = expires\n            state.unit = unit\n        end\n        \n    elseif subevent == \"SPELL_AURA_REFRESH\" then\n        local destName = select(9,...)\n        destName = gsub(destName, \"%-[^|]+\", \"\") --strip realm name\n        local spellId = select(12,...)\n        if aura_env.trackedSpells[spellId] and IsInGroup() then\n            for _, state in pairs(allstates) do\n                if state.spellId == spellId and state.name == destName then\n                    local spellName = GetSpellInfo(spellId)\n                    local _,_,icon, count,_, duration, expires = WA_GetUnitAura(state.unit, spellName)\n                    \n                    state.show = true;\n                    state.changed = true;\n                    state.name = destName\n                    state.progressType = 'timed'\n                    state.autoHide = true\n                    state.changed = true\n                    state.spellId = spellId\n                    state.icon = icon\n                    state.duration = duration\n                    state.expirationTime = expires\n                    state.unit = state.unit\n                end\n            end\n        end\n        \n        \n    elseif subevent == \"SPELL_AURA_REMOVED\" then\n        local destName = select(9,...)\n        local spellId = select(12,...)\n        if aura_env.trackedSpells[spellId] and IsInGroup() then\n            local unit\n            for u in aura_env.GroupMembers() do\n                if UnitName(u) == destName then unit = u end\n            end\n            if not unit then return end\n            for k,v in pairs(allstates) do\n                if spellId == v.spellId and unit == v.unit then\n                    v.show = false\n                    v.changed = true\n                end                \n            end\n            \n        end\n    end\n    \n    if event==\"FRAME_UPDATE\" then        \n        table.wipe(aura_env.auraCount)\n        for _, v in pairs(allstates) do\n            \n            local unit            \n            for u in aura_env.GroupMembers() do\n                if UnitName(u) == v.name then unit = u end\n            end\n            if not unit then \n                v.show = false\n                v.changed = true\n            else\n                local spellName = GetSpellInfo(v.spellId)\n                local _,_,icon, count,_, duration, expires = WA_GetUnitAura(unit, spellName)\n                if not duration then\n                    v.show = false\n                    v.changed = true\n                else\n                    v.unit = unit\n                    local region = WeakAuras.GetRegion(aura_env.id, v.ID)\n                    local f = aura_env.GetFrame(v.unit)\n                    if f and region then\n                        aura_env.auraCount[v.unit] = aura_env.auraCount[v.unit] or 0\n                        local xoffset = aura_env.auraCount[v.unit]*region:GetWidth()+1   \n                        if aura_env.auraCount[v.unit]+1 > aura_env.maxAuraCount then\n                            xoffset = -3000\n                        end\n                        region:ClearAllPoints()\n                        region:SetPoint(\"CENTER\", f, \"CENTER\",xoffset+aura_env.xOffset,aura_env.yOffset)                \n                        aura_env.auraCount[v.unit] = aura_env.auraCount[v.unit] + 1 \n                    end\n                end\n                \n            end \n            \n        end\n    end\n    \n    return true\n    \n    \nend",
