				["init"] = {
					["custom"] = "--CHANGE HERE--\naura_env.maxAuraCount = 4\naura_env.xOffset = 0\naura_env.yOffset = 2\n---------------\n\n\naura_env.auraCount = {}\n\naura_env.activeMitigation = { --Spell - Buff\n    [203720] = 203819, --Demon Spikes\n    [53600]  = 132403, --SotR\n    [192081] = 192081, --Ironfur \n    [2565]   = 132404, --Shield Block\n    \n}\naura_env.trackedSpells = {\n    --Death Knight\n    [194679] = true, --Rune Tap\n    [48707]  = true, --Anti-Magic Shell\n    [55233]  = true, --Vampiric Blood\n    [48792]  = true, --Icebound Fortitude\n    [206977] = true, --Blood Mirror\n    [81256]  = true, --Dancing Rune Weapon\n    [207319] = true, --Corpe Shield\n    --Demon Hunter\n    [212800] = true, --Blur\n    [196555] = true, --Nether Walk\n    [162264] = true, --Metamorphosis (DPS)\n    [218256] = true, --Empower Wards\n    [187827] = true, --Metamorphosis (Tank)\n    [203819] = true, --Demon Spikes\n    --Warlock\n    [104773] = true, --Unending Resolve\n    [108416] = true, --Dark Pact\n    --Hunter\n    [186265] = true, --Aspect of the Turtle\n    --Rogue\n    [1966]   = true, --Feint\n    [31224]  = true, --Cloak of Shadows\n    [5277]   = true, --Evasion\n    [199754] = true, --Riposte\n    --Paladin\n    [498]    = true, --Divine Protection\n    [204018] = true, --Blessing of Spellwarding\n    [6940]   = true, --Blessing of Sacrifice\n    [1022]   = true, --Blessing of Protection\n    [642]    = true, --Divine Shield\n    [86659]  = true, --Guardian of the Ancient Kings\n    [31850]  = true, --Ardent Defender\n    [132403] = true, --SotR\n    --Monk\n    [122470] = true, --Touch of Karma\n    [122783] = true, --Diffuse Magic\n    [122278] = true, --Dampen Harm\n    [243435] = true, --Fortifying Brew (Heal)\n    [120954] = true, --Fortifying Brew (Tank)\n    [115176] = true, --Zen Meditation\n    --Mage\n    [45438]  = true, --Ice Block\n    --Druid\n    [61336]  = true, --Survival Instincts\n    [22812]  = true, --Barkskin\n    [200851] = true, --Rage of the Sleeper\n    [102342] = true, --Ironbark\n    [192081] = true, --Ironfur\n    --Warrior\n    [197690] = true, --Defensive Stance\n    [118038] = true, --Die by the Sword\n    [184364] = true, --Enraged Regeneration\n    [871]    = true, --Shield Wall\n    [23920]  = true, --Spell Reflection\n    [132404] = true, --Shield Block\n    --Priest\n    [47788]  = true, --Guardian Spirit\n    [33206]  = true, --Pain Suppression\n    [47585]  = true, --Dispersion\n    --Shaman\n    [108271]  = true, --Astral Shift\n    --Trinket\n    [253277] = true, --Ishkar's Felshield Emitter\n    \n}\n\n\n\n--https://wago.io/profile/asakawa\nfunction aura_env.GroupMembers(reversed, forceParty)\n    local unit  = (not forceParty and IsInRaid()) and 'raid' or 'party'\n    local numGroupMembers = forceParty and GetNumSubgroupMembers()  or GetNumGroupMembers()\n    local i = reversed and numGroupMembers or (unit == 'party' and 0 or 1)\n    return function()\n        local ret \n        if i == 0 and unit == 'party' then \n            ret = 'player'\n        elseif i <= numGroupMembers and i > 0 then\n            ret = unit .. i\n        end\n        i = i + (reversed and -1 or 1)\n        return ret\n    end\nend\n\n\n-- Send this function a group/raid member's unitID or GUID and it will return their raid frame.\nfunction aura_env.GetFrame(target)\n    if not UnitExists(target) then\n        if type(target) == \"string\" and target:find(\"Player\") then\n            target = select(6,GetPlayerInfoByGUID(target))\n        else\n            return \n        end\n    end \n    --PitBull4\n    if IsAddOnLoaded(\"PitBull4\") then\n        for _,frame in pairs(PitBull4.all_frames_list) do\n            if frame.classification == \"Party\" and frame.unit then\n                return frame                \n            end\n        end\n    end\n    --ShadowUF\n    if IsAddOnLoaded(\"ShadowedUnitFrames\") then\n        if IsInRaid() then\n            if ShadowUF.enabledUnits.raid then\n                for _,frame in pairs(ShadowUF.Units.unitFrames) do\n                    if frame.unitType == \"raid\" and frame:IsVisible() and frame.unit and UnitIsUnit(frame.unit, target)\n                    then\n                        return frame\n                    end\n                end\n            end\n        else\n            if ShadowUF.enabledUnits.party then\n                for _,frame in pairs(ShadowUF.Units.headerFrames.party) do\n                    if type(frame) == \"table\" and frame.unitType == \"party\" and frame:IsVisible() and frame.unit and UnitIsUnit(frame.unit, target)\n                    then\n                        return frame\n                    end\n                end\n            end\n        end\n    end\n    -- CompactRaid\n    if IsAddOnLoaded(\"CompactRaid\") then\n        return CompactRaid:FindUnitFrame(target)\n    end\n    -- Healbot\n    if IsAddOnLoaded(\"HealBot\") then\n        for _,frame in pairs(HealBot_Unit_Button) do\n            if UnitIsUnit(frame.unit, target) then\n                return frame\n            end\n        end\n    end\n    -- Vuhdo\n    if IsAddOnLoaded(\"VuhDo\") and VUHDO_CONFIG[\"SHOW_PANELS\"] then\n        for _, v in pairs(VUHDO_UNIT_BUTTONS) do\n            if v[1].raidid and UnitIsUnit(v[1].raidid, target) then\n                return v[1]\n            end \n        end\n    end\n    -- grid (1)\n    if IsAddOnLoaded(\"Grid\") then\n        for _, frame in pairs(Grid.modules.GridFrame.registeredFrames) do\n            if frame:IsVisible() then\n                if frame.unit and UnitIsUnit(frame.unit, target) then\n                    return frame\n                end\n            end\n        end\n    end\n    --Grid2\n    if IsAddOnLoaded(\"Grid2\") then\n        for _, frame in pairs(Grid2Frame.registeredFrames) do\n            if frame:IsVisible() then\n                if frame.unit and UnitIsUnit(frame.unit, target) then\n                    return frame\n                end\n            end\n        end\n    end\n    -- ElvUI\n    if ElvUF then\n        for _,frame in pairs(ElvUF.objects) do\n            if (frame.unitframeType == \"raid\" \n                or frame.unitframeType == \"party\" \n                or frame.unitframeType == \"raid40\"\n            )\n            and frame:IsVisible() and frame.unit and UnitIsUnit(frame.unit, target)\n            then\n                return frame.Health\n            end\n        end\n    end\n    -- bdGrid\n    if IsAddOnLoaded(\"bdGrid\") then\n        for _,frame in pairs(oUF_bdGridRaid) do\n            if UnitIsUnit(frame.unit, target) then\n                return frame\n            end\n        end\n    end\n    --Lastly, default frames\n    if CompactRaidFrameContainer.groupMode == \"flush\" then\n        for _,frame in pairs(CompactRaidFrameContainer.flowFrames) do\n            if frame.unit and frame:IsVisible() and UnitIsUnit(frame.unit, target) then\n                return frame\n            end\n        end\n    else\n        for i = 1,8 do\n            for j = 1,5 do\n                local frame = _G[\"CompactRaidGroup\"..i..\"Member\"..j]\n                if frame and frame:IsVisible() and frame.unit and UnitIsUnit(frame.unit, target)\n                then\n                    return frame\n                end\n            end\n        end\n    end\n    --default party frames\n    for i=1,5 do\n        local frame = _G[\"CompactPartyFrameMember\"..i]\n        if frame and frame:IsVisible() and frame.unit and UnitIsUnit(frame.unit,target) then\n            return frame\n        end\n        \n    end\n    -- debug - uncomment below if you're seeing issues\n    --print(\"GlowOnDemand (WA) - No frame found. Target sent: \".. target)\nend",
