			["customText"] = "function(...)\n    local i = 1\n    local cur = GetTime()\n    local total = 0\n    \n    --get total damage taken\n    while aura_env.dmgTaken[i] do\n        --grab table entries with time and damage\n        local time = aura_env.dmgTaken[i][1]\n        local dmg = aura_env.dmgTaken[i][2]\n        \n        --if the damage happened outside of the timewindow\n        if cur > time + aura_env.lastSec then\n            --remove the entry\n            table.remove(aura_env.dmgTaken, i)\n        else --otherwise\n            --add up the damage and go to next entry\n            total = total + dmg\n            i = i + 1\n        end\n    end\n    \n    --Mastery\n    local mastery = 1 + GetMastery() / 200\n    \n    --Versatility\n    local vers = 1 + ((GetCombatRatingBonus(29) + GetVersatilityBonus(30)) / 100)\n    \n    --Leech\n    local leech = 1 + GetLifesteal() / 100\n    \n    --Guardian of Elune\n    local goe = ((select(4, GetTalentInfo(6,2,1))) and WA_GetUnitBuff(\"player\", GetSpellInfo(213680))) and 1.2 or 1\n    \n    --check artifact traits\n    local currentRank = 0\n    local loaded = IsAddOnLoaded(\"LibArtifactData-1.0\") or LoadAddOn(\"LibArtifactData-1.0\")\n    if loaded then\n        aura_env.LAD = aura_env.LAD or LibStub(\"LibArtifactData-1.0\")\n        if not aura_env.LAD:GetActiveArtifactID() then\n            aura_env.LAD:ForceUpdate()\n        end\n        local _, traits = aura_env.LAD:GetArtifactTraits()\n        if traits then\n            for _,v in ipairs(traits) do\n                if v.spellID == 200400 then\n                    currentRank = v.currentRank\n                    break\n                end\n            end\n        end\n    end\n    local trait = 1 + 0.05 * currentRank\n    \n    --Guardian Spirit\n    local gs = WA_GetUnitBuff(\"player\", GetSpellInfo(47788)) and 1.4 or 1\n    \n    --Divine Hymn\n    local dh = WA_GetUnitBuff(\"player\", GetSpellInfo(64844)) and 1.1 or 1\n    \n    --Protection of Tyr\n    local tyr = WA_GetUnitBuff(\"player\", GetSpellInfo(211210)) and 1.15 or 1\n    \n    --Life Cocoon\n    local lc = WA_GetUnitBuff(\"player\", GetSpellInfo(116849)) and 1.5 or 1\n    \n    --T17\n    local t17 = 1\n    local t17n, _, _, t17s = WA_GetUnitBuff(\"player\", GetSpellInfo(177969))\n    if t17n then\n        t17 = 1 + t17s * 0.1\n    end\n    \n    --T18\n    local t18 = WA_GetUnitBuff(\"player\", GetSpellInfo(192081)) and aura_env.GetNumSetPieces(\"T18\") >= 2 and 1.2 or 1\n    \n    --Skysec's Hold\n    local leg = IsEquippedItem(137025) and 0.100078 or 0 --restores ~10% of mastery affected maxhp\n    if leg > 0 then\n        --but the buff doesn't roll over like FR, so loses value if used twice in quick succession\n        local exp = select(7, WA_GetUnitBuff(\"player\", GetSpellInfo(208218))) or GetTime()\n        local rem = exp - GetTime()\n        if rem > 2 then\n            leg = leg * 1 / 3\n        elseif rem > 1 then\n            leg = leg * 2 / 3\n        end\n    end\n    \n    --calculate percentage and absolute healing values\n    local heal = total * aura_env.percDmg --damage taken * FR percentage\n    local perc = heal / UnitHealthMax(\"player\") --relative to maxHP\n    perc = math.max(aura_env.minHealthPerc, perc) --minimum FR percentage\n    perc = (perc * goe * trait * t17 * t18 * vers + leg) * mastery * gs * dh * tyr * lc --apply all multipliers\n    heal = perc * UnitHealthMax(\"player\") --get the actual heal value\n    \n    --store the values in aura_env variables to access them from other locations\n    aura_env.healing = heal\n    if aura_env.showAbsolute then\n        aura_env.display = aura_env.shortenNumber(heal)\n    else\n        aura_env.display = string.format(\"%.\"..aura_env.numDecimals..\"f%%\", perc*100)\n    end\n    \n    --coloring based on predicted percentage\n    local color = nil\n    for _, v in ipairs(aura_env.colors) do\n        if perc < v[1] then\n            break\n        else\n            color = v[2]\n        end\n    end\n    --should there be no entries, fall back to white\n    if not color then\n        color = \"ffffffff\"\n    end\n    \n    --the display variable will only contain one % so it can be printed correctly, replace that with %% so one % gets output into WA\n    return string.format(\"|c%s%s|r\", color, aura_env.display:gsub(\"%%\", \"%%%%\"))\nend",
