				["init"] = {
					["custom"] = "aura_env.options ={\n    xoffset = 0, --gap between interrupt and sephuz icon\n}\n\n\n\naura_env.trackedSpells = {\n    [208052] = 30,\n}\n--get the id of the interrupt tracker\n--users can change name of both WAs without the anchoring being affected\nfor id,data in pairs(WeakAurasSaved['displays']) do\n    if data.uniqueId and data.uniqueId == \"NnoggaM+InterruptTracker\" then\n        aura_env.interruptTrackerId = id\n    end    \nend\n\n\n\n\n\n\n",
