				["unit"] = "player",
				["event"] = "Health",
				["subeventPrefix"] = "SPELL",
				["custom"] = "function(allstates,event,...)\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        \n        local subevent = select(2,...)\n        if subevent == \"SPELL_AURA_APPLIED\" then\n            \n            local spellId = select(12,...)\n            local sourceName = select(5,...)            \n            local spellName = select(13,...)\n            local sourceGUID = select(4,...)\n            if aura_env.trackedSpells[spellId] then\n                if sourceName then sourceName = gsub(sourceName, \"%-[^|]+\", \"\") end --strip realm name\n                local idx = #allstates+1\n                allstates[idx] = {}\n                local state = allstates[idx]            \n                state.show = true\n                state.changed = true\n                state.sourceName = sourceName\n                state.progressType = 'timed'\n                state.autoHide = true\n                state.resort = true\n                state.duration = aura_env.trackedSpells[spellId]\n                state.expirationTime = GetTime()+aura_env.trackedSpells[spellId] \n                local icon = select(3,GetSpellInfo(spellId))\n                state.icon = icon\n                state.sourceGUID = sourceGUID\n                state.ID = idx\n                return true\n            end\n            \n        end\n    end\n    \n    \n    --position the icons according to the interrupt tracker\n    if event == \"FRAME_UPDATE\" then\n        for idx,v in pairs(allstates) do\n            if v.show == true then\n                local anchored = false\n                local region = WeakAuras.GetRegion(aura_env.id,idx)\n                if WeakAuras.clones[aura_env.interruptTrackerId] then\n                    for cloneId,clone in pairs(WeakAuras.clones[aura_env.interruptTrackerId]) do\n                        if clone.state.show == true and clone.state.sourceGUID == v.sourceGUID then\n                            --region:ClearAllPoints();\n                            local size = WeakAurasSaved['displays'][aura_env.interruptTrackerId].height                            \n                            region:SetPoint(\"CENTER\",clone.icon,\"CENTER\",-(size+aura_env.options.xoffset),0)\n                            --region:SetPoint(\"BOTTOMRIGHT\",clone.icon,\"CENTER\",-12.5,-12.5)\n                            region:SetWidth(size)\n                            region:SetHeight(size)\n                            anchored = true\n                            break\n                        end\n                    end\n                end\n                if anchored == false then\n                    region:ClearAllPoints()\n                    region:SetPoint(\"CENTER\",UIParent,\"CENTER\",-2500,0)\n                    --region:SetPoint(\"TOPRIGHT\", UIParent, \"TOPLEFT\",-1500)\n                    --region:SetPoint(\"BOTTOMRIGHT\", UIParent, \"BOTTOMLEFT\",-1500)\n                end\n            end\n        end\n    end\n    \n    \n    \n    \nend",
